import React from "react";
import classes from "./title.module.css";

function Title() {
  return (
    <div className={classes.list}>
      <img
        className={classes.img}
        src="https://abstracthdwallpapers.files.wordpress.com/2012/07/black-and-white-architecture-photography-1280x1024.jpg"
      />
      <div className={classes.prof}>
        <img
          src="https://pbs.twimg.com/profile_images/1153463025061552128/2PIAbE_k_400x400.jpg"
          alt=""
        />
        <div>Danny</div>
        <p>
          Дэ́ниел Майкл «Дэ́нни» Де Ви́то-мла́дший (англ. Daniel Michael “Danny”
          DeVito, Jr.; род. 17 ноября 1944, Нептьюн, США) — американский актёр,
          режиссёр, продюсер. Номинант на премию «Оскар» за фильм «Эрин
          Брокович».
        </p>
      </div>
    </div>
  );
}

export default Title;
